import React,{Component} from 'react';
import axios from 'axios';
import Doctorfound from './Doctorfound';

class BookAppoinment extends Component{
    state={
         doctorname:'',ptname:'',ptage:'',ptphnno:'',ptemail:'',ptappdate:'',ptstbltime:'' 
    };


    inputchanged = e => {
        this.setState({ [e.target.name]: e.target.value });
      };
    appoinmentpost= event =>{
        event.preventDefault();
        axios.post('http://127.0.0.1:8000/appoinment/appoinment/', this.state.appoinment).then((response) => {
            console.log(response);
        }, (error) => {
            console.log(error);
        });
  };

    render(){
        return(
            <div classNameName="hompagebody">
                <div className="row justify-content-end">
                    <div className="col-lg-7">
                        <div className="popup_box ">
                            <div className="popup_inner">
                                <h3>
                                    Book an 
                                <span>Appointment</span>
                                </h3>
                                <form action="#">
                                    <div className="row">
                                        <Doctorfound />
                                        <div className="col-xl-9">
                                            <input type="text" value={this.state.appoinment.ptname} onChange={this.inputchanged} placeholder="Your name " />
                                        </div>
                                        <div className="col-xl-3">
                                            <input type="text" value={this.state.appoinment.ptage} onChange={this.inputchanged} placeholder="Your age" />
                                        </div>
                                        <div className="col-xl-6">
                                            <input type="text" value={this.state.appoinment.ptphnno} onChange={this.inputchanged} placeholder="Phone number " />
                                        </div>
                                        <div className="col-xl-6">
                                            <input type="email" value={this.state.appoinment.ptemail} onChange={this.inputchanged} placeholder="Email Address" />
                                        </div>
                                        <div className="col-xl-6">
                                            <input className="datepicker" value={this.state.appoinment.ptappdate} onChange={this.inputchanged} placeholder="Appointment Date" />
                                        </div>
                                        <div className="col-xl-6">
                                            <input className="timepicker" value={this.state.appoinment.ptstbltime} onChange={this.inputchanged} placeholder="Suitable time" />
                                        </div>
                                        <div className="col-xl-12">
                                            <button type="submit" onClick={this.appoinmentpost} className="boxed-btn3">Make an Appointment</button>
                                        </div>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default BookAppoinment;
